Actie / Komedie
107 minuten

geregisseerd door Evan Goldberg en Seth Rogen
met James Franco, Jonah Hill en Seth Rogen

De film volgt zes vrienden die opgesloten zitten na een reeks vreemde, catastrofistische gebeurtenissen die Los Angeles hebben verwoest. Als de wereld buiten zich ontrafelt, zorgen de slinkende voorraden en claustrofobische omgeving ervoor dat hun vriendschap scheurtjes begint te vertonen.



